import { Avatar, Box, Button, Stack, Text, VStack } from "@chakra-ui/react";
import React from "react";
import avatarSrc from "../assets/Myphoto.png";

const Footer = () => {
  return (
    <Box
      bgColor={"blackAlpha.900"}
      color={"whiteAlpha.700"}
      minH={"48"}
      px={"16"}
      py={["16", "8"]}
    >
      <Stack direction={["column", "row"]} h={"full"} alignItems={"center"} spacing={"16"}>
        <VStack w={"full"} alignItems={["center", "flex-start"]} spacing={"6"}>
          <Text fontWeight={"bold"} fontSize={"lg"}>About Our Website</Text>
          <Text
            fontSize={"sm"}
            letterSpacing={"widest"}
            textAlign={["center", "left"]}
          >
            Experience the ultimate crypto trading app in India. Our guidance is second to none, and our prices are remarkably affordable.
          </Text>
          <Button
            colorScheme={"teal"}
            size={"xl"} // Double the size
            variant={"solid"}
            px={"8"} // Increase padding
            py={"6"} // Increase padding
          >
            Learn More
          </Button>
          <Button
            colorScheme={"blue"}
            size={"xl"} // Double the size
            variant={"solid"}
            px={"8"} // Increase padding
            py={"6"} // Increase padding
          >
            Contact Us
          </Button>
        </VStack>

        <VStack>
          <Avatar boxSize={"28"} mt={["4", "0"]} src={avatarSrc} />
          <Text fontSize={"lg"}>GAUTAM OP</Text>
        </VStack>
      </Stack>
    </Box>
  );
};

export default Footer;
